import React from 'react';
import{
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
} from "react-router-dom";
import {Home, AboutUs} from './screen'

const Navigation =() => {

    return(
        <Router>
            <Switch>
                <Route path="/home">
                    <Home/>
                </Route>
            </Switch>
        </Router>
    )
}

export default Navigation;
